import React from 'react';
import {
  Nav,
  NavLink,
  NavMenu,
} from './FooterElements.js';

import '../../styles/footer.css';

var style = {
  backgroundColor: "rgb(236, 196, 149)",
  textAlign: "center",
  padding: "20px",
  position: "fixed",
  left: "0",
  bottom: "0",
  height: "60px",
  width: "100%",
  color: "rgb(59, 61, 61)"
}

var phantom = {
display: 'block',
padding: '20px',
height: '60px',
width: '100%',
}

function Footer({ children }) {
  return (
      <div>
          <div style={phantom} />
          <div style={style}>
          <Nav>
        <NavMenu>
          <NavLink to='/about' activeStyle>
            About
          </NavLink>
          <NavLink to='/services' activeStyle>
            Services
          </NavLink>
          <NavLink to='/contact-me' activeStyle>
            Contact Me
          </NavLink>
          {/* Second Nav */}
          {/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
        </NavMenu>
      </Nav>
          </div>
      </div>
  )
}
export default Footer;
